import React from "react";

const VisibilityFilter = ({ VisibilityFilter, setVisibilityFilter }) => {
  return (
    <div>
      <h2>VISIBILITY FILTER</h2>
      <button onClick={() => setVisibilityFilter("SHOW_ALL")}>All</button>
      <button onClick={() => setVisibilityFilter("SHOW_COMPLETED")}>Completed</button>
      <button onClick={() => setVisibilityFilter("SHOW_ACTIVE")}>Not Completed</button>
    </div>
  );
};

export default VisibilityFilter;
